description:
Movie Info: Dedh Ishqiya is a 2014 Indian comedy thriller Hindi film directed by Abhishek Chaubey starring Madhuri Dixit, Arshad Warsi, Naseeruddin Shah, and Huma Qureshi in the lead roles. It is a sequel of Ishqiya and is produced by Raman Maroo and Vishal Bharadwaj. The film has released worldwide on January 10, 2014, with 1200 screens release in India. The trailer of the film was released on November 8, 2013

